import NavBar from "./components/navbar/Navbar";
import Home from "./components/pages/home/Home"

import {
  BrowserRouter,
  Route,
  Routes
} from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <NavBar/>
      <Routes>
        <Route exact path="/wee">
          <Home />
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
